CREATE TABLE users(
    id NUMBER PRIMARY KEY,
    name VARCHAR2(50) NOT NULL,
    email VARCHAR2(50),
    dob DATE,
    doj DATE,
    contest_rating NUMBER
);
--DROP TABLE users;

-- DROP TABLE star_rating;
CREATE TABLE star_rating(
    min_rating NUMBER,
    max_rating NUMBER,
    star NUMBER
);


